import React from 'react';


class CarouselMobileItem extends React.Component {

    render(){
        return  (
        <div className={ "carousel-item-mobile "+(this.props.isActive ? "active" : "inactive" ) } >
          <a
            href={this.props.url}>
            <div className="card b-10">
              <img
                src={this.props.image}
                className="d-block w-100 h-300p card-img-top"
                alt="..." />
              <div className="card-body">
                <h2 className="card-title">{this.props.title}</h2>
                <h3 className="card-subtitle mb-2 text-muted">Some quick example text...</h3>
              </div>
              <div className="card-footer">
                <div className="card-link">바로가기</div>
              </div>
            </div>
          </a>
        </div>
        );
    }
}

export default CarouselMobileItem;
